import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import DashBoard from './DashBoard';
import { BrowserRouter } from "react-router-dom";




ReactDOM.render( 
<BrowserRouter>
  <App/>
  <DashBoard/>
</BrowserRouter>,

    document.getElementById("root")
);
